import React, { Fragment, Component } from "react";
import Navbar from "./components/NavBar";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar title="Home" icon='fas fa-home"' />
      </div>
    );
  }
}

export default App;
